import React, { useState } from 'react';
import TextField from '@mui/material/TextField';
import { useHistory, useParams } from 'react-router-dom';
import Autocomplete from '@mui/material/Autocomplete';

export default function SearchRecord({ records }) {
    const history = useHistory();
    const params = useParams();
    console.log(records);
    const dateList = records;
    //const dateList = records.map((element, indice) => { return { indice: indice, element: element } });
    const idDoctor = localStorage.getItem('token');
    const [idP] = useState(params.idPatient);
    return (
        <Autocomplete
            disablePortal
            id="combo-box-demo"
            options={dateList} //Aquí va la lista de pacientes
            sx={{ width: 300 }}
            onChange={(_, index) => history.push(`/view-record/${idDoctor}/${idP}/${index}`)}
            renderInput={(params) => <TextField {...params} label="Busca registro" />}
        />
    );
}
